import React from 'react';

function Register () {
  return (
      <form className='sign-up'>
        <input type='email' 
               classname='sign-up__email'
               placeholder='Email'
               defaultValue='' />
        <input type='password'
               className='sign-up__password'
               placeholder='Пароль'
               defaultValue='' />
        <button type='submit'
                className='sign-up__submit'>Зарегистрироваться</button>
      </form>  
  )
}

export default Register;
